z.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><section><header>about digg: frequently asked questions</header><paragraph>We offer the finest website to our the public who might remember the implementation of <link target=\"_self\" url_id=\"118\">digg</link> (v1/v2) and how it empowered the user to desicide what makes it to the homepage via user submitted votes or diggs.</paragraph></section></section></section>\n','ezxmltext',284,'eng-US',3,0,'',5),(0,119,69,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><section><header>about digg: frequently asked questions</header><paragraph>We offer the finest website to our the public who might remember the implementation of <link target=\"_self\" url_id=\"118\">digg</link> (v1/v2) and how it empowered the user to desicide what makes it to the homepage via user submitted votes or diggs.</paragraph></section></section></section>\n','ezxmltext',284,'eng-US',3,0,'',6),(0,119,69,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><section><header>about digg: frequently asked questions</header><paragraph>We offer the finest website to our the public who might remember the implementation of <link target=\"_self\" url_id=\"118\">digg</link> (v1/v2) and how it empowered the user to desicide what makes it to the homepage via user submitted votes or diggs.</paragraph></section></section></section>\n','ezxmltext',284,'eng-US',3,0,'',7),(0,119,69,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><section><header>about digg: frequently asked questions</header><paragraph>We offer the finest website to the public who might remember the implementation of <link target=\"_self\" url_id=\"118\">digg</link>.com under kevin rose startup days (as digg api v1 + v2 but absolutely no v3 rewrite) and how it empowered the user to decide what stories make it to the homepage via user submitted votes or diggs daily promoting the good in the news submitted.</paragraph></section></section></section>\n','ezxmltext',284,'eng-US',3,0,'',8),(0,119,69,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><section><header>about digg: frequently asked questions</header><paragraph>We offer the finest website to the public who might remember the implementation of <link target=\"_self\" url_id=\"118\">digg</link>.com under kevin rose startup days (as digg api v1 + v2 but absolutely no v3 rewrite) and how it empowered the user to decide what stories make it to the homepage via user submitted votes or diggs daily promoting the good in the news submitted. Well sir we are bringing it back!</paragraph></section></section></section>\n','ezxmltext',284,'eng-US',3,0,'',9),(0,156,69,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><ol><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Digg is a technology news website that combines social bookmarking, blogging, RSS, and non-hierarchical editorial control. With digg, users submit stories for review, but rather than allow an editor to decide which stories go on the homepage, the users do.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Once a story is submitted by a user it is instantly posted in the <link url_id=\"120\">digg area queue</link>. This is a temporary holding place where stories wait to be promoted to the homepage. To help promote stories to the homepage, simply visit the digg area and digg stories you think are cool. Once a story has received enough diggs, it is instantly promoted. Should the story not receive enough diggs, or is reported, it eventually falls out of the digg area queue. Digg works because a large group of people actively promote good stories to the homepage. Since this site\'s content is user-driven, it is up to YOU to contribute.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Submitting stories is easy. Simply click on \"<link url_id=\"121\">submit a story</link>\" and enter the URL of the story you would like to submit. Then fill out a title, description, and category for the story. Should you encounter a potential duplicate, please digg the original story and do not submit a duplicate entry.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">There are currently two types of digg news you can add to your website, digg homepage news and digg user news. If you would like to add the latest digg homepage stories to your website simply click \"<link url_id=\"122\">add digg news</link>\" on the digg homepage right navigation. To add digg user news, (your latest diggs, or someone else\'s) visit the user\'s profile you would like to add (digg.com/users/username) and click \"add this feed\" in the digging history navigation.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Digg currently supports single click blog posting to Typepad, Blogger, Live Journal, Moveable Type, and Wordpress. To blog any story within digg, simply click \"blog story\".</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Every time you digg, submit, or comment on a story it is bookmarked and stored within your user profile. To visit your user profile, click your username on the top navigation or enter any user\'s address manually: digg.com/users/username.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Ever want to group multiple friend\'s RSS feeds together? With digg friends you can now track all your friend\'s diggs/stories/comments under one place. Visit the \"friends\" tab under your user profile to add and remove friends.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Digg gives moderation control back to the community. Should you run across any stories with bad links, irrelevant content, or duplicate entries, please report them using the \"problem\" report feature.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Next to each comment is a small \"x\" which allows users to block other user\'s comments. If you\'ve accidentally blocked someone and wish to unblock them, you can do so in your personal profile account settings.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">To contact us, please visit our <link url_id=\"123\">contact page</link>.</paragraph></li></ol></paragraph></section>\n','ezxmltext',285,'eng-US',3,0,'',5),(0,156,69,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><ol><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3