 enter the URL of the story you would like to submit. Then fill out a title, description, and category for the story. Should you encounter a potential duplicate, please digg the original story and do not submit a duplicate entry.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">There are currently two types of digg news you can add to your website, digg homepage news and digg user news. If you would like to add the latest digg homepage stories to your website simply click \"<link url_id=\"122\">add digg news</link>\" on the digg homepage right navigation. To add digg user news, (your latest diggs, or someone else\'s) visit the user\'s profile you would like to add (digg.com/users/username) and click \"add this feed\" in the digging history navigation.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Digg currently supports single click blog posting to Typepad, Blogger, Live Journal, Moveable Type, and Wordpress. To blog any story within digg, simply click \"blog story\".</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Every time you digg, submit, or comment on a story it is bookmarked and stored within your user profile. To visit your user profile, click your username on the top navigation or enter any user\'s address manually: digg.com/users/username.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Ever want to group multiple friend\'s RSS feeds together? With digg friends you can now track all your friend\'s diggs/stories/comments under one place. Visit the \"friends\" tab under your user profile to add and remove friends.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Digg gives moderation control back to the community. Should you run across any stories with bad links, irrelevant content, or duplicate entries, please report them using the \"problem\" report feature.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Next to each comment is a small \"x\" which allows users to block other user\'s comments. If you\'ve accidentally blocked someone and wish to unblock them, you can do so in your personal profile account settings.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">To contact us, please visit our <link url_id=\"123\">contact page</link>.</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">Use our <link url_id=\"127\">atom feed</link> in your favorite rss reader and keep up with our latest news.</paragraph></li></ol></paragraph></section>\n','ezxmltext',285,'eng-US',3,0,'',9),(286,158,69,0,1,'','ezboolean',286,'eng-US',3,1,'',5),(286,158,69,0,1,'','ezboolean',286,'eng-US',3,1,'',6),(286,158,69,0,1,'','ezboolean',286,'eng-US',3,1,'',7),(286,158,69,0,1,'','ezboolean',286,'eng-US',3,1,'',8),(286,158,69,0,1,'','ezboolean',286,'eng-US',3,1,'',9),(0,181,69,0,NULL,'','ezkeyword',287,'eng-US',3,0,'',5),(0,181,69,0,NULL,'','ezkeyword',287,'eng-US',3,0,'',6),(0,181,69,0,NULL,'','ezkeyword',287,'eng-US',3,0,'',7),(0,181,69,0,NULL,'','ezkeyword',287,'eng-US',3,0,'',8),(0,181,69,0,NULL,'','ezkeyword',287,'eng-US',3,0,'',9),(0,182,69,0,NULL,'','ezdatetime',288,'eng-US',3,0,'',5),(0,182,69,0,NULL,'','ezdatetime',288,'eng-US',3,0,'',6),(0,182,69,0,NULL,'','ezdatetime',288,'eng-US',3,0,'',7),(0,182,69,0,NULL,'','ezdatetime',288,'eng-US',3,0,'',8),(0,182,69,0,NULL,'','ezdatetime',288,'eng-US',3,0,'',9),(0,183,92,0,NULL,'Contact','ezstring',429,'eng-US',2,0,'contact',1),(0,183,92,0,NULL,'Contact','ezstring',429,'eng-US',2,0,'contact',2),(0,183,92,0,NULL,'contact','ezstring',429,'eng-US',2,0,'contact',3),(0,183,92,0,NULL,'contact','ezstring',429,'eng-US',2,0,'contact',4),(0,183,92,0,NULL,'contact','ezstring',429,'eng-US',2,0,'contact',5),(0,183,92,0,NULL,'contact','ezstring',429,'eng-US',2,0,'contact',6),(0,