atform',1),(0,384,837,0,132,'eZ Publish 6 Project HomePage + Tools','ezurl',8063,'eng-US',3,0,'',1),(0,372,837,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><embed view=\"embed\" size=\"medium\" align=\"right\" object_id=\"701\" custom:offset=\"0\" custom:limit=\"5\"/>eZ Publish is an award-winning, enterprise-grade Open Source Content Management System and development framework with functionality for web publishing, media portals, intranets, e-commerce and extranets. eZ Publish has a flexible content engine that serves as the core for dynamic and personalized websites. eZ Publish comes with much functionality out-of-the-box, but its power lies in its award-winning customization capabilities.</paragraph></section>\n','ezxmltext',8064,'eng-US',3,0,'',1),(0,373,837,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><embed view=\"embed\" size=\"medium\" align=\"right\" object_id=\"702\" custom:offset=\"0\" custom:limit=\"5\"/>Welcome to eZ Publish maintained by 7x. This website provides information related to the continued development and support of the eZ Publish CMS software platform.</paragraph><paragraph>Here you can find the links to the <link target=\"_self\" url_id=\"133\">activity centers</link> that eZ Publish end users visit for more information and activity.</paragraph><paragraph>We offer the very finest world renowned cms that has been installed worldwide tens of thousands of times by normal people to power their website using the a flexible content management system and generic web development framework eZ Publish provides by default.</paragraph></secti