 platform to use to build their own digg clone based websites. The digg clone project home page is also coming soon to <link url_id=\"149\">https://clone.digg.one</link></paragraph></section>\n','ezxmltext',8760,'eng-US',3,0,'',1),(0,372,882,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>Today we completed migration of the database configuration to use the soon to be open sourced voting solution plugin required for the digg sigma / digg clone projects.</paragraph><paragraph>With sevenx_digg extension we will include the design templates and datatype needed to vote for content objects within our lamp php cms eZ Publish 6.</paragraph><paragraph>With the digg clone project we will be releasing our full current site sources and the full mysql database required to start people off with a reference platform to use to build their own digg clone based websites. The digg clone project home page is also coming soon to <link url_id=\"149\">https://clone.digg.one</link></paragraph></section>\n','ezxmltext',8760,'eng-US',3,0,'',2),(0,373,882,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>More news coming soon as we rush to release!</paragraph></section>\n','ezxmltext',8761,'eng-US',3,0,'',1),(0,373,882,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph>More news coming soon as we rush to release!</paragraph></section>\n','ezxmltext',8761,'eng-US',3,0,'',2),(8762,374,882,0,1